import React, { useEffect, useState } from 'react';
import { getUserProfile } from '../lib/auth';

const profile = () => {
    const [user, setUser] = useState(null)
    useEffect (() => {
        getUserProfile().then((user) => user)
    })

    return (
        <pre>{JSON.stringify(user, null, 2)}</pre>
    );
};

export default profile;
